// GetAllEchoes returns all echoes.
func GetAllEchoes() []Echo {
	if len(echoesData.Echoes) == 0 {
		return []Echo{}
	}
	return echoesData.Echoes[0].Echo
}

// GetEchoByID returns the echo with the given ID, or nil if not found.
func GetEchoByID(id string) *Echo {
	echoes := GetAllEchoes()
	for i := range echoes {
		if echoes[i].ID == id {
			return &echoes[i]
		}
	}
	return nil
}
